import { Fragment } from 'react'
import tasks from '../assets/tasks.json'
import { useNavigate } from 'react-router-dom';
import { useSelector } from "react-redux";

function Homepage() {
    const isAuth = useSelector(state => state.auth.isAuthenticated);
    const data = tasks.tasks
    console.log(data)
    const navigate = useNavigate();
    let cars = [{
        "id": 20,
        "mileage": 41300,
        "make": "Golf",
        initialRegistration: "09/02/2010"
      }, {
        "id": 21,
        "mileage": 51300,
        "make": "Passat",
        initialRegistration: "06/04/2012"
      }, {
        "id": 22,
        "mileage": 61300,
        "make": "Audi",
        initialRegistration: "02/01/2018"
      }, {
        "id": 23,
        "mileage": 20300,
        "make": "Touran",
        initialRegistration: "17/09/2013"
      }, {
        "id": 24,
        "mileage": 10300,
        "make": "Polo",
        initialRegistration: "26/07/2014"
      }];
      console.log("Cars",cars)
      
      const click=()=>{
        {
            let sortedCars1 = cars.sort((a, b) => new Date(...a.initialRegistration.split('/').reverse()) - new Date(...b.initialRegistration.split('/').reverse()));
            console.log(sortedCars1);}
      }

      const sortByDate=()=>{
          let sorted=data.sort((a,b)=>new Date(...a.dueDate.split('/').reverse()) - new Date(...b.dueDate.split('/').reverse()))
      console.log(sorted)
        }
    return (
        <Fragment>
<button onClick={click}> Yoooo</button>
            <div className="container mt-5">
                <div className='row'>
                    <div className="col-md-10">
                        <h2>User Management</h2>
                    </div>

                </div>
            </div>
            <div className='container'>
                <table className='table table-stripped'>
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th> <button type="button" onClick={sortByName}>
                                Name
                            </button></th>
                            <th>Priority</th>
                            <th> <button type="button" onClick={sortByDate}>
                                DueDate
                            </button></th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map((data) => (
                            <tr key={data.id}>
                                <td>{data.id}</td>
                                <td>{data.name}</td>
                                <td>{data.priority}</td>
                                <td>{data.dueDate}</td>
                                <td><button onClick={() => {
                                    navigate('/Detailspage',
                                        {
                                            state:
                                                { key: data.id }
                                        }
                                    )
                                }
                                }>Details</button></td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </Fragment>
    )
}

export default Homepage;
